// CWA Logo - white on blue inverse logo square
// Source: https://cascadewater.org/wp-content/uploads/2017/07/white-on-blue-inverse-logo-square-final.jpg
// Original dimensions: 651x578px

export const CWA_LOGO_BASE64 = '';

export function getCWALogoBytes(): Uint8Array {
  const binaryString = atob(CWA_LOGO_BASE64);
  const bytes = new Uint8Array(binaryString.length);
  for (let i = 0; i < binaryString.length; i++) {
    bytes[i] = binaryString.charCodeAt(i);
  }
  return bytes;
}
